var tipuesearch = {"pages": [{'title': 'About', 'text': 'cmsimde_site \n', 'tags': '', 'url': 'About.html'}, {'title': '上課內容', 'text': '', 'tags': '', 'url': '上課內容.html'}, {'title': 'W6', 'text': '使用Leo: \n 開啟小黑窗接著輸入leo就能打開Leo \n 接著開啟cd2022的config裡面的pelican \n 打開後就能開始編輯 \n 修改裡面原有的資料，改成自己的學號和標題 \n 這裡網址改成自己倉儲 \n 修改自己想要的標題資訊 \n 修改好後對local-blog按下右鍵，在按下Goto Script \n 接著就在小黑窗打上 \n cd tmp \n cd cd2022 \n pelican markdown -o blog -s local_publishconf.py \n 第一次打會出現一個錯誤，需要在cd2022的markdown裡面加個images的資料夾就可以解決錯誤 \n 都好了後可以推看看倉儲 \n acp" " \n 檢查有沒有完成。 \n 推送至blog: \n 使用Leo來記錄自己每週做的事情 \n 編輯好後對local-blog按下右鍵，在按下Goto Script \n 在小黑窗打上 \n cd tmp \n cd cd2022 \n pelican markdown -o blog -s local_publishconf.py \n acp" " \n 推好了後到blog檢查有沒有推送成功。 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '每個組員分配不同的繪圖軟體 我是利用NX12軟體進行繪製 繪製出Pick and Place demo範例所需的零組件 將零件組裝好後轉成stl檔在利用Coppeliasim模擬機械運轉 目前零件尚未畫好 還有正在研究程式碼讓機械手臂正常運轉 \n W8 \n 組員分別以Solvespace、NX及Onshape繪製uarm機械手臂的零件 \n 接下來將uarm組合件存為stl檔後轉入coppeliasim \n \n 以GUI Slider方式控制前三軸作動 \n \n \n \n \n \n \n   \n \n \n \n \n 在繪圖的方面因為沒學過以上三種繪圖軟體，所以我就從頭開始學習使用NX繪製零件 \n 而組合圖的部分只要按照老師給的組合圖的組合就沒有太大的問題 \n 在CoppeliaSim裡控制前三軸作動需要正確的讓連桿連接 \n 這方面花費較多的時間去研究 \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W10', 'text': '', 'tags': '', 'url': 'W10.html'}, {'title': 'w10_block_ui', 'text': '\n \n \n \n \n   \n \n \n \n \n', 'tags': '', 'url': 'w10_block_ui.html'}, {'title': 'w10_nx_integ', 'text': '\n \n \n \n \n   \n \n \n \n \n', 'tags': '', 'url': 'w10_nx_integ.html'}, {'title': 'w10_ssh', 'text': '\n \n \n \n \n   \n \n \n \n \n', 'tags': '', 'url': 'w10_ssh.html'}, {'title': 'W11', 'text': '將w8-w10上課內容以及分配工作上傳至小組倉儲。 \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '本週透過上課時所給的程式碼，套用到NX程式裡，就可以跑出來顯示組合件裡的零件組和總重量。 所需的零件總共有155個。 \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'cadlab startup', 'text': '/downloads/w12startup.mp4 \n W16 \n 利用tkinter GUI介面slider控制uArm機械手臂 \n \n \n \n \n \n   \n \n \n \n \n online exam \n 1.已知左側綠色底座的 uArm 機械手臂, 其基座座標原點位於絕對座標 (1.0, 0.25, 0), 啟動模擬後 green_suctionpad_frame 座標原點則位於 (0.22859, 0.26047, 0.36576), 請列出運算式說明, 啟動模擬後 joint1, joint2 與 joint3 分別以逆時針旋轉 5 度後, 求 green_suctionpad_frame 的絕對座標值.( x:-1.0000 , y: +0.2500 , z: -0.1786 ) \n \n \n \n \n   \n \n \n \n \n \n 2.已知左側 uarm 前方的紅色方塊頂端中心座標值為 (0.2, 0.4, 0.1), 請列出運算式說明左側 uarm 機械手臂的 joint1, joint2 與 joint3 該如何旋轉才能讓 end effector 的吸盤末端中心點移動至紅色方塊頂端中心? Reference: \n \n \n \n \n   \n \n \n \n \n \n', 'tags': '', 'url': 'cadlab startup.html'}, {'title': 'midterm', 'text': '製作uarm機械手臂 \n 組員分別以Solvespace和NX及Onshape完成零件繪製 \n 繪製好uarm零件後做組合 \n 接下來將uarm組合件存為stl檔後轉入coppeliasim \n \n 以GUI Slider方式控制前三軸作動 \n \n \n \n \n \n \n   \n \n \n \n \n 在繪圖的方面是沒有問題 \n 而組合圖的部分也沒有太大的問題 \n 按照老師給的組合圖細心的組合就能完成 \n 比較麻煩的是CoppeliaSim控制前三軸作動 \n 需要仔細將連桿連接 \n 這方面花費較多的時間去研究 \n 最後還是有順利完成前三軸的作動 \n', 'tags': '', 'url': 'midterm.html'}, {'title': '分組頁面', 'text': 'W8-W10  協同設計過程所負責的項目內容與心得。 \n W8 \n 組員分別以Solvespace、NX及Onshape繪製uarm機械手臂的零件 \n 接下來將uarm組合件存為stl檔後轉入coppeliasim \n \n 以GUI Slider方式控制前三軸作動 \n \n \n \n \n \n \n   \n \n \n \n \n 在繪圖的方面因為沒學過以上三種繪圖軟體，所以我就從頭開始學習使用NX繪製零件 \n 而組合圖的部分只要按照老師給的組合圖的組合就沒有太大的問題 \n 在CoppeliaSim裡控制前三軸作動需要正確的讓連桿連接 \n 這方面花費較多的時間去研究 \n \n W10 \n w10_block_ui \n \n \n \n \n \n   \n \n \n \n \n w10_nx_integ \n \n \n \n \n \n   \n \n \n \n \n w10_ssh \n \n \n \n \n \n   \n \n \n \n \n \n', 'tags': '', 'url': '分組頁面.html'}, {'title': '40971134', 'text': 'wink17 \n \n \n \n \n   \n \n \n \n \n wink18 \n \n \n \n \n   \n \n \n \n \n wink19 \n \n \n \n \n   \n \n \n \n \n wink20 \n \n \n \n \n   \n \n \n \n \n wink21 \n \n \n \n \n   \n \n \n \n', 'tags': '', 'url': '40971134.html'}]};